import React from 'react';

import PwButton from "../../Components/button";
import Navbar from "../../Components/Navbar";
import Partner from "../../Components/Partenaire";
import Card from "../../Components/card";

import './style.scss'

function Discoverpage() {
    return (
        <div className="discover-page">
            <Navbar></Navbar>
            <div className="body">
                <div className="container">
                    <div className="discover-text">
                        <h1 className="gradient-text-discover">Etudier avec les meilleurs musiciens du monde</h1>
                        <p>Vivez des masterclasses vidéo immersives où que vous soyez. De nouvelles masterclasses ajoutéees chaque mois.</p>
                    </div>
                    <div className="btn-container">
                        <PwButton variant={"primary"} size={"large"} title={"Connectez-vous"} link={'/login'}></PwButton>
                        <PwButton variant={"border"} size={"large"} title={"Essaie Version Gratuite"}></PwButton>
                    </div>
                </div>
                <Partner></Partner>
                <Card titre={"Concerto No.5 in A Majorr"} instrument={"piano"} auteur={"Nathan"} background={""}></Card>
            </div>
        </div>
    );
}

export default Discoverpage;
